import React, { useState } from 'react'
import './Buyorsell.css';
import tvl_bus from '../../Img/travel_bus.jfif';
import tvl_train from '../../Img/travel_train.WEBP'

const Buyorsell = () => {
  const [Isbuy, setIsbuy] = useState(true);

  const OnclickBuy=()=>{
setIsbuy(true);

  }
  const OnclickSell=()=>{
    setIsbuy(false);
  }
  return (
    
    <div id='buyorsell'>
        <div className='buyorsell'>
             <ul>
                <li className={Isbuy?'active':'notactive'} onClick={OnclickBuy}>
                    Buy
                </li>
                <li className={Isbuy?'notactive':'active'} onClick={OnclickSell}>
                    Sell
                </li>
             </ul>
        </div>
        <div className='buy_tck'>
           <ul className='buy_tck_source'>
            <li>
            <img src={tvl_bus} />
            </li>
            <li>
            <img src={tvl_train} />
            </li>
            <li>
            <img src={tvl_bus} />
            </li>
           </ul>
        </div>
        <div className='sell_tck'>

        </div>
    </div>
  )
}

export default Buyorsell
